def my_func(input1):
    # Convert the input string to a list of boolean values and operators
    tokens = []
    for char in input1:
        if char == 't':
            tokens.append(True)
        elif char == 'f':
            tokens.append(False)
        else:
            tokens.append(char)

    # Process the AND operations first
    i = 0
    while i < len(tokens):
        if tokens[i] == '&':
            # Perform the AND operation between the two surrounding values
            tokens[i - 1] = tokens[i - 1] and tokens[i + 1]
            # Remove the operator and the second operand
            del tokens[i:i + 2]
        else:
            i += 1

    # Process the OR operations
    result = tokens[0]
    i = 1
    while i < len(tokens):
        if tokens[i] == '|':
            result = result or tokens[i + 1]
        i += 2

    return result

